Pirkimų projektų vadovas (-ė) viešiesiems pirkimams
Litgrid – energetikos ateities centras. Įgyvendiname strateginius projektus ir rūpinamės šalies energetikos ateitimi. Čia dirbantys žmonės geriausiai žino, kaip sektorius atrodo dabar, ir koks jis bus po dešimtmečio ar net vėliau. Esame vienintelė komanda, kuri vienu metu vykdo skirtingas nacionalinio masto misijas: užtikriname stabilų šalies energetikos sistemos darbą, jungiame Lietuvos ir Europos ele
... 
būdis:
- organizuoti ir vykdyti pirkimus, laikantis tarptautinių pirkimo gerųjų praktikų, įskaitant skaidrumą, veiksmingumą ir sąžiningumą;
- dalyvauti tarptautinių pirkimų projektuose ir bendradarbiauti su įvairiais tiekėjais iš viso pasaulio;
- nuolat sekti ir įgyvendinti inovatyvius sprendimus ir technologijas pirkimo procese, siekiant efektyviai pasiekti rezultatus;
- stebėti ir analizuoti tarptautinius pirkimo rinkos pokyčius, tendencijas ir reguliavimo reikalavimus, siekiant būti šioje sri
...
ę profesinėse organizacijose;
- galimybę lanksčiai dirbti iš biuro ir iš namų;
- papildomas apmokamas atostogas ir apmokamą neatvykimą į darbą ligos atveju;
- nuotolines mankštas, sveikatos draudimą;
- darbo užmokestis nuo 2450 EUR iki 2900 EUR (su mokesčiais), nustatomą atsižvelgiant į turimą kompetenciją ir darbinę patirtį;
- finansinį skatinimą pagal LITGRID AB galiojančią tvarką.
Vietovė
- Vilnius, Vilniaus apskritis, Lietuva
Laikas
- Visa darbo diena
Įgūdžiai
Kalbos
- Lietuvių
Edita Šimanec

Turinys
Azoospermija atitinka visišką spermos nebuvimą spermoje, tai yra viena iš pagrindinių vyrų nevaisingumo priežasčių. Šią būklę pagal jos priežastį galima suskirstyti į:
- Obstrukcinė azoospermija: toje vietoje, kur turėtų praeiti spermatozoidai, yra obstrukcija, kuri gali atsirasti dėl pasikeitusių kraujagyslių, epididimio ar dėl vazektomijos operacijų;
- Ne obstrukcinė azoospermija: jai būdinga spermos gamybos stoka, kuri gali būti kažkokios įgimtos ligos pasekmė arba dėl sėklidžių insul
... 
rinčios įtakos spermos gamybai, laikymui ar pernešimui į šlaplę. Taigi pagrindinės priežastys yra šios:
- Smūgių sukelti sėklidžių ar epididimo pažeidimai;
- Vyrų reprodukcinės sistemos infekcijos;
- Naviko buvimas sėklidėje;
- Kai kurių chemoterapinių vaistų šalutinis poveikis;
- Kriptorchidizmas, kuris yra situacija, kai sėklidės nenusileidžia į kapšelį - daugiau suprask apie kriptorchidizmą;
- Varikocelė;
- Naujausios operacijos dubens srityje.
Be to, genetiniai pokyčiai taip pat gali sukelti
...
obstrukcinė azoospermija, gydymas yra chirurginis ir juo siekiama ištaisyti priežastį, leidžiant spermai vėl praeiti.
Netrukdomos azoospermijos atveju gydymas yra sudėtingesnis, todėl vyrui turi būti atliekami papildomi tyrimai, daugiausia hormoniniai, siekiant patikrinti jo reprodukcinį pajėgumą.
Bet kuriuo atveju vyrui visada labai svarbu kreiptis į psichologą, nes diagnozė gali sukelti neigiamų emocijų, kurios gali sukelti depresiją, ypač todėl, kad kai kurie vyrai gali jausti savo vyriškumą.

Projektų vadovas – stiklo gaminiai
Užduotys būsimam (-ai) darbuotojui (-ai):
- darbas su stiklo gaminių projektais;
- klientų paieška ir atranka;
- projektų valdymas nuo užsakymo gavimo iki įgyvendinimo;
- komercinių pasiūlymų ruošimas;
- sąmatos skaičiavimas;
- klientų konsultavimas.
Darbo vieta: Klaipėda
Darbo grafikas: 8-17, I-V.
Sudomino? Kandidatuok, skambink mums tel. 8-46 246648
Tikimės šių savybių ir įgūdžių:
- esi įgijęs aukštąjį techninį išsilavinimą;
- turi autoCAD programos pagrindus;
- moki skaityti brėžinius;
- gebi valdyti projektus nuo užsakymo gavimo iki įgyvendinimo;
- turi patirties skaičiuojant sąmatas;
- esi komunikabilus ir gebi greitai užmegzti kontaktą su klientais.
Siūlome:
- darbą kliento įmonėje tiesiogiai;
- darbo grafiką 8:00-17:00, savaitgalius turėsi laisvus;
- galimybę gauti priedus nuo padaryto rezultato ir pasiekto plano;
- patogią darbo vietą mieste.
- draugišką, padėti pasirengusį kolektyvą.

AUKSO BUČINYS
- Dvi nakvynės pasirinktos kategorijos numeryje;
- Pusryčiai viešbučio restorane „Pelikanas“;
- Salotos ir taurė vyno/sulčių dviem asmenims restorane „Pelikanas“;
- Pirčių komplekso paslaugos vakare (baseinas su masažine srove, sukūrinė vonia, garinė pirtis bei suomiška sauna);
- SPA terapijos (1val. trukmės):
- JAI -Aukso įvyniojimas+veido ir dekoltė masažas+ JAM-Aukso įvyniojimas+masažas su aukso nektaru.
- Baseinas+sukūrinė vonia 1 kartą prieš ar po SPA terapijos nuo 11-15val.
- Arbata SPA zonoje;
- Kvapni dovanėle;
- Chalatai bei šlepetės;
- Wi-Fi numeryje;
- Erdvi automobilių stovėjimo aikštelė;
- Esant galimybei, galimas vėlyvas išvykimas iki 16val.;
